package com.sqisoft.iqs.pf.vo;

public class WeekendVO {
	int week_div;
	String pj_id;
	String team_id;
	String team_name;
	String pre_state;
	String post_state;
	int week_contract;
	int week_income;
	int week_netincome;
	int week_ebit;
	int empl_id;
	String timestamp;
	public WeekendVO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public WeekendVO(int week_div, String pj_id,String team_id, String pre_state,
			String post_state, int week_contract, int week_income,
			int week_netincome, int week_ebit, int empl_id) {
		super();
		this.week_div = week_div;
		this.pj_id = pj_id;
		this.team_id=team_id;
		this.pre_state = pre_state;
		this.post_state = post_state;
		this.week_contract = week_contract;
		this.week_income = week_income;
		this.week_netincome = week_netincome;
		this.week_ebit = week_ebit;
		this.empl_id = empl_id;
	}
	
	public String getTeam_name() {
		return team_name;
	}
	public void setTeam_name(String team_name) {
		this.team_name = team_name;
	}
	public String getTeam_id() {
		return team_id;
	}
	public void setTeam_id(String team_id) {
		this.team_id = team_id;
	}
	public int getWeek_div() {
		return week_div;
	}
	public void setWeek_div(int week_div) {
		this.week_div = week_div;
	}
	public String getPj_id() {
		return pj_id;
	}
	public void setPj_id(String pj_id) {
		this.pj_id = pj_id;
	}
	public String getPre_state() {
		return pre_state;
	}
	public void setPre_state(String pre_state) {
		this.pre_state = pre_state;
	}
	public String getPost_state() {
		return post_state;
	}
	public void setPost_state(String post_state) {
		this.post_state = post_state;
	}
	public int getWeek_contract() {
		return week_contract;
	}
	public void setWeek_contract(int week_contract) {
		this.week_contract = week_contract;
	}
	public int getWeek_income() {
		return week_income;
	}
	public void setWeek_income(int week_income) {
		this.week_income = week_income;
	}
	public int getWeek_netincome() {
		return week_netincome;
	}
	public void setWeek_netincome(int week_netincome) {
		this.week_netincome = week_netincome;
	}
	public int getWeek_ebit() {
		return week_ebit;
	}
	public void setWeek_ebit(int week_ebit) {
		this.week_ebit = week_ebit;
	}
	public int getEmpl_id() {
		return empl_id;
	}
	public void setEmpl_id(int empl_id) {
		this.empl_id = empl_id;
	}
	public String getTimestamp() {
		return timestamp;
	}
	public void setTimestamp(String timestamp) {
		this.timestamp = timestamp;
	}
	@Override
	public String toString() {
		return "WeekendVO [week_div=" + week_div + ", pj_id=" + pj_id
				+ ", team_id=" + team_id + ", pre_state=" + pre_state
				+ ", post_state=" + post_state + ", week_contract="
				+ week_contract + ", week_income=" + week_income
				+ ", week_netincome=" + week_netincome + ", week_ebit="
				+ week_ebit + ", empl_id=" + empl_id + ", timestamp="
				+ timestamp + "]";
	}
	
	
}